import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import SpaceDetails from './pages/SpaceDetails';
import AddSpace from './pages/AddSpace';
import Favorites from './pages/Favorites';
import HostDashboard from './pages/HostDashboard';
import UserDashboard from './pages/UserDashboard';
import Reservation from './pages/Reservation';
import Login from './pages/Login';
import Register from './pages/Register';
import AIPlanner from './pages/AIPlanner';
import './index.css';

function App() {
  // Simulación de datos iniciales
  const initialSpaces = [
    { id: 1, name: 'Garage Grande', location: 'Centro', price: 150, type: 'garage', description: 'Espacioso y bien iluminado', rating: 4.5 },
    { id: 2, name: 'Pequeño Almacén', location: 'Sur', price: 80, type: 'almacen', description: 'Perfecto para almacenamiento temporal', rating: 4.2 },
    { id: 3, name: 'Garage Privado', location: 'Norte', price: 200, type: 'garage', description: 'Ideal para vehículos grandes', rating: 4.8 },
    { id: 4, name: 'Oficina Compartida', location: 'Este', price: 120, type: 'oficina', description: 'Incluye WiFi y electricidad', rating: 4.0 },
    { id: 5, name: 'Almacén Techado', location: 'Centro', price: 100, type: 'almacen', description: 'Buena ventilación y seguridad', rating: 4.6 },
    { id: 6, name: 'Garage Subterráneo', location: 'Oeste', price: 180, type: 'garage', description: 'Protección contra el clima', rating: 4.7 },
    { id: 7, name: 'Almacén Seco', location: 'Sur', price: 90, type: 'almacen', description: 'Condiciones perfectas para almacenamiento', rating: 4.3 },
    { id: 8, name: 'Oficina Ejecutiva', location: 'Centro', price: 220, type: 'oficina', description: 'Excelente para reuniones privadas', rating: 4.9 },
    { id: 9, name: 'Garage Moderno', location: 'Norte', price: 250, type: 'garage', description: 'Diseño innovador y seguro', rating: 4.8 },
    { id: 10, name: 'Espacio Multiusos', location: 'Oeste', price: 110, type: 'almacen', description: 'Adaptable a tus necesidades', rating: 4.4 },
    { id: 11, name: 'Garage Básico', location: 'Este', price: 70, type: 'garage', description: 'Simple pero funcional', rating: 4.1 },
    { id: 12, name: 'Oficina Compacta', location: 'Centro', price: 130, type: 'oficina', description: 'Perfecta para freelancers', rating: 4.2 },
    { id: 13, name: 'Almacén Industrial', location: 'Norte', price: 300, type: 'almacen', description: 'Ideal para equipos grandes', rating: 4.9 },
    { id: 14, name: 'Garage Familiar', location: 'Sur', price: 150, type: 'garage', description: 'Amplio y cómodo', rating: 4.7 },
    { id: 15, name: 'Oficina Deluxe', location: 'Oeste', price: 350, type: 'oficina', description: 'Todas las comodidades incluidas', rating: 5.0 },
  ];

  const [spaces, setSpaces] = useState(initialSpaces); // Lista de espacios
  const [favorites, setFavorites] = useState(() => {
    const savedFavorites = localStorage.getItem('favorites');
    return savedFavorites ? JSON.parse(savedFavorites) : [];
  });
  const [user, setUser] = useState(null); // Usuario autenticado

  // Guardar favoritos en localStorage
  useEffect(() => {
    localStorage.setItem('favorites', JSON.stringify(favorites));
  }, [favorites]);

  // Manejar favoritos
  const handleFavorite = (id) => {
    setFavorites((prev) =>
      prev.includes(id) ? prev.filter((fav) => fav !== id) : [...prev, id]
    );
  };

  // Agregar un nuevo espacio
  const handleAddSpace = (newSpace) => {
    setSpaces((prev) => [...prev, newSpace]);
  };

  // Manejar reservas
  const handleReserve = (spaceId, startDate, endDate) => {
    console.log(`Reserva confirmada para el espacio ${spaceId}, desde ${startDate} hasta ${endDate}`);
  };

  // Rutas protegidas
  const ProtectedRoute = ({ children, condition }) => {
    return condition ? children : <Login setUser={setUser} />;
  };

  return (
    <Router>
      <div className="flex flex-col min-h-screen">
        {/* Navbar */}
        <Navbar user={user} setUser={setUser} />

        {/* Contenido principal */}
        <div className="flex-grow">
          <Routes>
            {/* Página de Inicio */}
            <Route
              path="/"
              element={
                <Home
                  spaces={spaces}
                  onFavorite={handleFavorite}
                  favorites={favorites}
                  user={user}
                  onReserve={handleReserve}
                />
              }
            />

            {/* Detalles del Espacio */}
            <Route
              path="/space/:id"
              element={
                <SpaceDetails
                  spaces={spaces}
                  onFavorite={handleFavorite}
                  user={user}
                />
              }
            />

            {/* Reservar Espacio */}
            <Route
              path="/space/:id/reserve"
              element={<Reservation spaces={spaces} />}
            />

            {/* Añadir Espacio */}
            <Route
              path="/add-space"
              element={
                <ProtectedRoute condition={user?.role?.includes('host')}>
                  <AddSpace user={user} onAddSpace={handleAddSpace} />
                </ProtectedRoute>
              }
            />

            {/* Espacios Favoritos */}
            <Route
              path="/favorites"
              element={
                <ProtectedRoute condition={!!user}>
                  <Favorites
                    spaces={spaces}
                    favorites={favorites}
                    onFavorite={handleFavorite}
                  />
                </ProtectedRoute>
              }
            />

            {/* Dashboard del Anfitrión */}
            <Route
              path="/host-dashboard"
              element={
                <ProtectedRoute condition={user?.role?.includes('host')}>
                  <HostDashboard spaces={spaces} />
                </ProtectedRoute>
              }
            />

            {/* Dashboard del Usuario */}
            <Route
              path="/user-dashboard"
              element={
                <ProtectedRoute condition={!!user}>
                  <UserDashboard
                    user={user}
                    favorites={favorites}
                    spaces={spaces}
                  />
                </ProtectedRoute>
              }
            />

            {/* Planificador AI */}
            <Route
              path="/ai-planner"
              element={
                <ProtectedRoute condition={!!user}>
                  <AIPlanner spaces={spaces} />
                </ProtectedRoute>
              }
            />

            {/* Registro */}
            <Route path="/register" element={<Register setUser={setUser} />} />

            {/* Login */}
            <Route path="/login" element={<Login setUser={setUser} />} />
          </Routes>
        </div>

        {/* Footer */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
